import React, { useState } from "react";

function App() {
  const [headingText, setHeading] = useState("Hello");

  function handle() {
    setHeading("Submitted");
  }
  return (
    <>
      <div className="container">
        <h1>{headingText}</h1>
        <input type="text" placeholder="What's Your Name?" />
        <button onClick={handle}> Submit</button>
      </div>
    </>
  );
}
export default App;
